import React from "react";
import logo from "../images/react-logo.png";

const Header = (): JSX.Element => {
    return (
        <div  className="nav">
            <img src={logo} className="nav-logo" alt="nav logo"/>
            <nav>
                <ul className="nav-items">
                    <li>Pricing</li>
                    <li>About</li>
                    <li>Contact</li>
                </ul>
            </nav>
        </div>
    );
};
export default Header;
